	private static void printArea(Area a, boolean water) {
		System.out.print("{\"type\": \"" + (water ? "water" : "land") + "\", \"path\": [");
		PathIterator i = a.getPathIterator(null, 0);
		String s = "";
		while (!i.isDone()) {
			double[] coords = new double[6];
			int t = i.currentSegment(coords);
			if (t == PathIterator.SEG_MOVETO) {
				if (!"".equals(s)) s += ",";
				s += "[[" + (Math.floor(coords[0] * 100) / 100) + "," + (Math.floor(coords[1] * 100) / 100) + "]";
			} else if (t == PathIterator.SEG_LINETO) {
				s += ",[" + (Math.floor(coords[0] * 100) / 100) + "," + (Math.floor(coords[1] * 100) / 100) + "]";
				//s += ",[" + coords[0] + "," + coords[1] + "]";
			} else if (t == PathIterator.SEG_CLOSE) {
				s += "]";
			} else {
				throw new RuntimeException("Unsupported Op: " + t);
			}
			i.next();
		}
		System.out.print(s);
		System.out.print("]}");
	}

	private static String printPath(ArrayList<Point2D.Double> ps) {
		StringBuilder b = new StringBuilder();
		for (int i = 0; i < ps.size(); i++) {
			b.append("[");
			b.append(Math.floor(ps.get(i).getX() * 100) / 100);
			b.append(",");
			b.append(Math.floor(ps.get(i).getY() * 100) / 100);
			b.append("]");
			if (i != ps.size() - 1) {
				b.append(",");
			}
		}
		return b.toString();
	}

	// return null if no border is shared.
	private static ArrayList<Point2D.Double> getBorder(Area a, Area b) {
		// Build point list for both areas
		// Check if any points are on line segments defined by both areas
		ArrayList<ArrayList<Point2D.Double>> aap = getPoints(a);
		HashSet<Point2D.Double> bp = new HashSet<>();
		for (ArrayList<Point2D.Double> bbp : getPoints(b)) {
			bp.addAll(bbp);
		}
		for (ArrayList<Point2D.Double> ap : aap) {
			boolean common = false;
			boolean[] contains = new boolean[ap.size()];
			for (int i = 0; i < contains.length; i++) {
				contains[i] = bp.contains(ap.get(i));
				if (contains[i]) common = true;
			}
			if (!common) continue;
			int bestScore = Integer.MAX_VALUE;
			int bestI = 0;
			// Could do this in O(N) with dynamic programming.
			for (int i = 0; i < contains.length; i++) {
				int debt = 0;
				int score = 0;
				for (int j = 0; j < contains.length; j++) {
					if (contains[(i + j) % contains.length]) {
						score += debt;
						debt = 0;
					} else {
						debt++;
					}
				}
				if (score < bestScore) {
					bestScore = score;
					bestI = i;
				}
			}
			ArrayList<Point2D.Double> ret = new ArrayList<>();
			for (int i = 0; i < contains.length; i++) {
				int p = (i + bestI) % contains.length;
				if (contains[p]) ret.add(ap.get(p));
			}
			return ret;
		}
		return null;
	}

	// b is the upper one.
	private static ArrayList<Point2D.Double> getBorder2(Area a, Area b) {
		Area x = new Area(a);
		x.intersect(b);
		ArrayList<ArrayList<Point2D.Double>> xp = getPoints(x);
		HashSet<Point2D.Double> bp = new HashSet<>();
		for (ArrayList<Point2D.Double> bbp : getPoints(b)) {
			bp.addAll(bbp);
		}
		ArrayList<ArrayList<Point2D.Double>> rets = new ArrayList<>();
		for (ArrayList<Point2D.Double> ap : xp) {
			boolean common = false;
			boolean[] contains = new boolean[ap.size()];
			for (int i = 0; i < contains.length; i++) {
				contains[i] = bp.contains(ap.get(i));
				if (contains[i]) common = true;
			}
			if (!common) continue;
			int bestScore = Integer.MAX_VALUE;
			int bestI = 0;
			// Could do this in O(N) with dynamic programming.
			for (int i = 0; i < contains.length; i++) {
				int debt = 0;
				int score = 0;
				for (int j = 0; j < contains.length; j++) {
					if (contains[(i + j) % contains.length]) {
						score += debt;
						debt = 0;
					} else {
						debt++;
					}
				}
				if (score < bestScore) {
					bestScore = score;
					bestI = i;
				}
			}
			ArrayList<Point2D.Double> ret = new ArrayList<>();
			for (int i = 0; i < contains.length; i++) {
				int p = (i + bestI) % contains.length;
				if (contains[p]) ret.add(ap.get(p));
			}
			if (!rets.contains(ret)) rets.add(ret);
		}
		if (rets.isEmpty()) return new ArrayList<>();
		// Now, figure out the order of the paths in "ret". We want to minimize the distance of the stitch line.
		double[][] endToZeroDists = new double[rets.size()][rets.size()];
		for (int i = 0; i < rets.size(); i++) {
			for (int j = 0; j < rets.size(); j++) {
				if (i == j) endToZeroDists[i][j] = Double.MAX_VALUE;
				else endToZeroDists[i][j] = rets.get(i).get(rets.get(i).size() - 1).distance(rets.get(j).get(0));
			}
		}
		// This is in reverse order.
		ArrayList<ArrayList<Point2D.Double>> ordered = new ArrayList<>();
		// row with the largest minimum is the end.
		double max = 0;
		int maxRow = 0;
		for (int i = 0; i < endToZeroDists.length; i++) {
			double min = Double.MAX_VALUE;
			for (int j = 0; j < endToZeroDists[i].length; j++) {
				if (endToZeroDists[i][j] < min) min = endToZeroDists[i][j];
			}
			if (min > max) {
				max = min;
				maxRow = i;
			}
		}
		ordered.add(rets.get(maxRow));
		while (ordered.size() < rets.size()) {
			// Find the closest transition to the previous item's first.
			double min = Double.MAX_VALUE;
			ArrayList<Point2D.Double> mv = null;
			for (ArrayList<Point2D.Double> ar : rets) {
				if (ordered.contains(ar)) continue;
				double d = ar.get(ar.size() - 1).distance(ordered.get(ordered.size() - 1).get(0));
				if (d < min) {
					min = d;
					mv = ar;
				}
			}
			ordered.add(mv);
		}
		Collections.reverse(ordered);
		ArrayList<Point2D.Double> ret = new ArrayList<>();
		for (ArrayList<Point2D.Double> ar : ordered) ret.addAll(ar);
		return ret;
	}

	private static ArrayList<Point2D.Double> rotate(ArrayList<Point2D.Double> in, int first) {
		ArrayList<Point2D.Double> ar = new ArrayList<>();
		for (int i = first; i < in.size(); i++) {
			ar.add(in.get(i));
		}
		for (int i = 0; i < first; i++) {
			ar.add(in.get(i));
		}
		return ar;
	}

	private static ArrayList<ArrayList<Point2D.Double>> getPoints(Area a) {
		PathIterator i = a.getPathIterator(null, 0);
		ArrayList<ArrayList<Point2D.Double>> ret = new ArrayList<>();
		ArrayList<Point2D.Double> cr = new ArrayList<>();
		while (!i.isDone()) {
			double[] coords = new double[6];
			int t = i.currentSegment(coords);
			if (t == PathIterator.SEG_MOVETO) {
				cr.add(new Point2D.Double(r(coords[0]), r(coords[1])));
			} else if (t == PathIterator.SEG_LINETO) {
				Point2D.Double np = new Point2D.Double(r(coords[0]), r(coords[1]));
				if (np.distance(cr.get(cr.size() - 1)) > 0.000001) {
					cr.add(np);
				}
			} else if (t == PathIterator.SEG_CLOSE) {
				ret.add(cr);
				cr = new ArrayList<>();
			} else {
				throw new RuntimeException("Unsupported Op: " + t);
			}
			i.next();
		}
		return ret;
	}

	private static Path2D.Double pathFromString(String str) {
		String prevCommand = "";
		StringTokenizer t = new StringTokenizer(str, "MLZ", true);
		Path2D.Double path = new Path2D.Double();
		path.setWindingRule(Path2D.WIND_EVEN_ODD);
		while (t.hasMoreTokens()) {
			String command = t.nextToken();
			if (" ".equals(command)) {
			  continue;
			} else if ("Z".equals(command)) {
				path.closePath();
			} else {
				double[] point = parsePoint(t.nextToken(), false);
				if ("L".equals(command)) {
					path.lineTo(point[0], point[1]);
				} else if ("M".equals(command)) {
					path.moveTo(point[0], point[1]);
				} else {
					throw new RuntimeException("unrecognized command " + command);
				}
			}
		}
		return path;
	}

	private static double r(double a) {
		return Math.floor(a * 1000) / 1000;
	}

	private static double[] prev = new double[]{0, 0};
	private static double[] parsePoint(String p, boolean relative) {
		prev = new double[] { Double.parseDouble(p.substring(0, p.indexOf(","))) + (relative ? prev[0] : 0), Double.parseDouble(p.substring(p.indexOf(",") + 1, p.length())) + (relative ? prev[1] : 0) };
		return prev;
	}

